function getTime( ) {
	var d = new Date( ); 
	d.setHours( d.getHours() ); // offset from local time
	var h = (d.getHours() % 12) || 12; // show midnight & noon as 12
	return (
		( h < 10 ? '0' : '') + h +
		( d.getMinutes() < 10 ? ':0' : ':') + d.getMinutes() +
                // optional seconds display
		// ( d.getSeconds() < 10 ? ':0' : ':') + d.getSeconds() + 
		( d.getHours() < 12 ? ' AM' : ' PM' )
	);

}

var outmsg = getTime() + " [" + ( cache.msg.channel ? (cache.msg.channel || "DM") : "DM") + "] ("+ (cache.msg.author ? (cache.msg.author.id || "0") : "0") + ")" + (cache.msg.author ? (cache.msg.author.username || "Unknown") : "Unknown") + ": " + (cache.msg.content || "Cant Read")

